		/* assert(condition, message)
		
			Simple assert method for unit-testing.
		
		*/
	
	function assert(condition, message) {
		if(logUnitTests()) {
			console.log(message);
		}
		
		if (!condition) {
			if(message) {
				message = ' : ' + message;
			} else {
				message = '';
			}
			message = 'Assertion failed' + message;
			if (typeof Error !== 'undefined') {
				throw new Error(message);
			}
			throw message; // Fallback
			return false;
		}
		
		return true;
	}
	
